import Slider from "react-slick";import ava01 from '../../assets/images/ava-01.j'

const Testimonials = () => {
  return (
    <Slider>
      <div className="testimonial py-4 px-3">
        <p>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Maiores,
          officiis dolor. Saepe minus at soluta aliquam, veniam quidem iusto
          quis dolores labore, sed consectetur a quo maxime ex officia ad.
        </p>
      </div>
    </Slider>
  );
};

export default Testimonials;
